import React from "react";
import { Link } from "react-router-dom";
import logo from "../../images/logos/logo.png";

const Navigation = () => {
  return (
    <nav>
      <div className="navigation">
        <div className="logo">
          <Link to="">
            <img src={logo} alt="" />
          </Link>
        </div>
        <ul className="menu"></ul>
      </div>
    </nav>
  );
};

export default Navigation;
